message:
Escutem um judeu racista explicando pros retardados que acreditam em tv e nos livros do mec que o NACIONAL SOCIALISMO não tem nada a ver com o socialismo comunista.
Este historiador judeu tambem afirma que HITLER NUNCA PERSEGUIU JUDEUS...

@derrubandoaspedrasguiasdageorgia

Tradução
Christelle Néant (@DonbassInsider) acredita que seus compatriotas franceses não entendem que seus impostos estão financiando ataques contra civis DPR e LPR, através do envio de sistemas de artilharia CAESAR que são usados ​​para matar civis de Donetsk. Este vídeo foi amplamente distribuído, legendado em árabe, espanhol... e até em francês.

